import React, { Component } from 'react';

class Sider extends Component {
    render() {
        return (
            <div>
                <div className="h6">
                    <p>Hay! Choose Your Genre</p>
                </div>
                <div className="mt-3 d-flex p-2">
                    <button type="button" class="btn btn-outline-dark">Action</button>
                </div>
                <div className="mt-3">   
                    <button type="button" class="btn btn-outline-dark">Comedy</button>
                </div>
                <div className="mt-3"> 
                    <button type="button" class="btn btn-outline-dark">Drama</button>
                </div> 
                <div className="mt-3">    
                    <button type="button" class="btn btn-outline-dark">Fantesy</button>
                </div>
                <div className="mt-3">
                    <button type="button" class="btn btn-outline-dark">Horror</button>
                </div>
            </div>
        );
    }
}

export default Sider;
